import { PlaneGeometry, MeshBasicMaterial, Mesh, Vector3, Quaternion, Euler, Texture, Sphere } from "../../threejs/three.module.js";

const floor = `
data:image/png;base64,
`;

export class GroundPlane {
  constructor() {
    this._geometry = new PlaneGeometry();
    this._material = new MeshBasicMaterial({
      transparent: true,
      depthTest: true,
      depthWrite: false
    });
    this._size = 1;
    this.mesh = new Mesh(this._geometry, this._material);
    this.mesh.renderOrder = -1;
    this.updateTexture(floor);
  }

  adaptToContent(box) {
    this.mesh.quaternion.copy(
      new Quaternion().setFromEuler(new Euler(1.5 * Math.PI, 0, 0))
    );
    // const size = box.getSize(new Vector3());
    const center = box.getCenter(new Vector3());
    const position = new Vector3(
      center.x,
      box.min.y,
      center.z,
    );
    this.mesh.position.copy(position);
    const sphere = box ? box.getBoundingSphere(new Sphere()) : undefined;
    const size = (sphere ? sphere.radius : 1) * this._size;
    const imageRatio = 1170 / 562; // From base64 source
    const scale = new Vector3(1 * imageRatio, 1, 1).multiplyScalar(size * 2);
    this.mesh.scale.copy(scale);
  }

  updateTexture(source) {
    const image = new Image();
    image.src = source;
    const txt = new Texture();
    this._texture = txt;
    this._texture.image = image;
    this._material.map = this._texture;
    image.onload = () => {
      this._texture.image = image;
      this._texture.needsUpdate = true;
    };
  }
}